pragma solidity ^0.4.23;

import "./TierCap.sol";

contract InvestingLimits is TierCap {
    uint256 preICOMinVestingEth;
    uint256 preICOMaxVestingEth; // ???
    uint256 ICOMinVestingEth;
    uint256 ICOMaxVestingEth;

    constructor() public {
        preICOMinVestingEth = uint256(50e3).div(ETH_USD).mul(1 ether);
        ICOMinVestingEth = 0.1 ether;
        ICOMaxVestingEth = 300 ether;
    }

    function minVestingEth() 
    public 
    view
    onlyWhieNotClosed
    purchaseAllowed
    returns (uint256) {
        Rounds round = getTier();
        if (round == Rounds.preICO) {
            return preICOMinVestingEth;
        } else {
            return ICOMinVestingEth;
        }
    }

    function maxVestingEth() 
    public 
    view
    onlyWhieNotClosed
    purchaseAllowed
    returns (uint256) {
        Rounds round = getTier();
        if (round == Rounds.preICO) {
            return preICOMaxVestingEth;
        } else {
            return ICOMaxVestingEth;
        }
    }
}
